import React from 'react';
import Sidebar from './Sidebar';
import ListProcesses from './ListProcesses';
import './App.css';

function App() {
  return (
    <div className="app-container">
      <Sidebar />
      <main className="content-area">
        <ListProcesses />
      </main>
    </div>
  );
}

export default App;
